script: |
  super -f text -I q10616.spq | sort > q10616.out

inputs:
  - name: q10616.spq
    data: |
      SELECT + col0 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE + col0 NOT IN ( + + col0, col1 - - + ( - col2 ) + + col1 / + 31, + col0 + col1 * - 19 );
  - name: tab2

outputs:
  - name: q10616.out
    data: |
